import React from 'react'
import { moneyFormat } from '../helpers'
<link rel="stylesheet" href="./headerstyle" />
function Header({ total, money }) {
  return (
    <>
        <div>
            {total > 0 && money - total !== 0 &&(
              <div className='header'>Kalan $ {moneyFormat(money - total)} var!</div>
            )}
            {total === 0 &&(
              <div className='header'>Harcamak için $ {moneyFormat(money)} var!</div>
            )}
            {money - total === 0 &&(
              <div className='header'>Harcanacak para kalmadı.</div>
            )}
        </div>
    </>
  )
}

export default Header
